// ============================================
// components/Header.js
// ============================================
import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import { useCart } from '../context/CartContext';
import { useWishlist } from '../context/WishlistContext';
import './Header.css';

const Header = () => {
  const { isAuthenticated, logout, user } = useAuth();
  const { cartCount } = useCart();
  const { wishlistCount } = useWishlist();
  const navigate = useNavigate();
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  return (
    <header className="header">
      <div className="container">
        <div className="header-content">
          <Link to="/" className="logo">
            <div className="logo-icon">
              <svg viewBox="0 0 100 100" className="header-logo">
                {/* Lotus petals */}
                <path d="M50 15 Q35 25 30 40 Q35 55 50 50 Q65 55 70 40 Q65 25 50 15" fill="#2c5530" opacity="0.8"/>
                <path d="M50 15 Q40 20 35 35 Q40 50 50 45 Q60 50 65 35 Q60 20 50 15" fill="#2c5530" opacity="0.6"/>
                
                {/* Human figure - S curve body */}
                <path d="M50 25 Q45 35 50 45 Q55 55 50 65" stroke="#2c5530" stroke-width="3" fill="none" stroke-linecap="round"/>
                
                {/* Head */}
                <circle cx="50" cy="25" r="4" fill="#2c5530"/>
                
                {/* Arms */}
                <path d="M50 35 Q45 30 50 25" stroke="#2c5530" stroke-width="2" fill="none" stroke-linecap="round"/>
                <path d="M50 35 Q55 30 50 25" stroke="#2c5530" stroke-width="2" fill="none" stroke-linecap="round"/>
                
                {/* Additional lotus petals for depth */}
                <path d="M50 20 Q30 30 25 45 Q30 60 50 55 Q70 60 75 45 Q70 30 50 20" fill="none" stroke="#2c5530" stroke-width="1" opacity="0.4"/>
              </svg>
            </div>
            <div>
              <h1>RasayanaBio</h1>
              <p>Pure. Natural. Effective.</p>
            </div>
          </Link>

          <nav className={`nav ${mobileMenuOpen ? 'active' : ''}`}>
            <Link to="/" onClick={() => setMobileMenuOpen(false)}>Home</Link>
            <Link to="/products" onClick={() => setMobileMenuOpen(false)}>Products</Link>
            <Link to="/about" onClick={() => setMobileMenuOpen(false)}>About</Link>
            <Link to="/contact" onClick={() => setMobileMenuOpen(false)}>Contact</Link>
          </nav>

          <div className="header-actions">
            {isAuthenticated ? (
              <div className="user-menu">
                <Link to="/profile" className="icon-btn">ðŸ‘¤</Link>
                <Link to="/orders" className="icon-btn">ðŸ“¦</Link>
                <button onClick={handleLogout} className="btn-logout">Logout</button>
              </div>
            ) : (
              <>
                <Link to="/login" className="btn-login">Login</Link>
                <Link to="/register" className="btn-register">Sign Up</Link>
              </>
            )}
            <Link to="/wishlist" className="wishlist-btn">
              â™¥
              {wishlistCount > 0 && <span className="wishlist-badge">{wishlistCount}</span>}
            </Link>
            <Link to="/cart" className="cart-btn">
              ðŸ›’
              {cartCount > 0 && <span className="cart-badge">{cartCount}</span>}
            </Link>
            <button 
              className="mobile-menu-btn"
              onClick={() => setMobileMenuOpen(!mobileMenuOpen)}
            >
              {mobileMenuOpen ? 'âœ•' : 'â˜°'}
            </button>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
